import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.css";
import logo from "./logo.JPG";
import facebook from "./facebook.jpg";
import twitter from "./twitter.jpg";
import instagram from "./instagram.jpg";
console.log(logo);
class MainTemplate extends Component {
  state = {};
  render() {
    return (
      <div className="card text-center">
        <div className="card-header text-left">
          <a className="navbar-brand" href="#">
            <img
              src={logo}
              width="60"
              height="60"
              alt="logo"
              style={{ borderRadius: "10px", marginRight: "0px" }}
            ></img>
          </a>
          <a href="#" style={{ color: "#091763" }}>
            {" "}
            Home{" "}
          </a>
          <a href="#" style={{ color: "#091763" }}>
            {" "}
            Home2{" "}
          </a>
          <a href="#" style={{ color: "#091763" }}>
            {" "}
            Home3{" "}
          </a>
          <a href="#" style={{ color: "#091763" }}>
            {" "}
            Login{" "}
          </a>
          <a className="float-right m-2" href="#">
            <img
              src={facebook}
              width="30"
              height="30"
              alt="logo"
              style={{ borderRadius: "75px" }}
            ></img>
          </a>{" "}
          <a className="float-right m-2" href="#">
            <img
              src={twitter}
              width="30"
              height="30"
              alt="logo"
              style={{ borderRadius: "75px" }}
            ></img>
          </a>{" "}
          <a className="float-right m-2" href="#">
            <img
              src={instagram}
              width="30"
              height="30"
              alt="logo"
              style={{ borderRadius: "75px" }}
            ></img>
          </a>{" "}
        </div>
        <div className="card-body">
          <h5 className="card-title">Akanksha Stone Crushers</h5>
          <p className="card-text">
            With supporting text below as a natural lead-in to additional
            content.
            <br />
            <br />
            <br />
            <br />
            <br />
            <br />
            <br />
          </p>
          <a
            href="#"
            className="btn"
            style={{
              backgroundColor: "#091763",
              color: "#edeef3",
              fontWeight: "10px",
            }}
          >
            Go somewhere
          </a>
        </div>
        <div
          className="card-footer text-muted"
          style={{ backgroundColor: "#091763", color: "white" }}
        >
          <div className="row row-list m-1">
            <div className="container-paragraph m-2">
              <pre style={{ color: "white" }}>
                Outer Ring Rd, <br />
                Banashankari 3rd Stage, <br />
                Banashankari, <br />
                Bengaluru,
                <br />
                Karnataka pin - 560085
              </pre>
            </div>
            <div className="container-paragraph m-2">
            <pre style={{ color: "white" }}>
                Outer Ring Rd, <br />
                Banashankari 3rd Stage, <br />
                Banashankari, <br />
                Bengaluru,
                <br />
                Karnataka pin - 560085
              </pre>
            </div>
            <div className="container-paragraph m-2">row1</div>
            <div className="container-paragraph m-2">row1</div>
          </div>
        </div>
      </div>
    );
  }
}

export default MainTemplate;
